  \"noaa-high-resolution-sea-surface-winds-data-from-synthetic-aperture-radar-sar-on-the-radarsat-27a2e1\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Synthetic Aperture Radar (SAR)-derived
  high resolution wind products are calculated from high resolution SAR images of
  normalized radar cross section (NRCS) of the Earth's surface. Backscattered microwave
  radar returns from the ocean surface are strongly dependent on wind speed and direction.
  When no wind is present, the surface of the water is smooth, almost glass-like.
  Radar energy will largely be reflected away and the radar cross section will be
  low. As the wind begins to blow, the surface roughens and surface waves begin to
  develop. As the wind continues to blow more strongly, the amplitude of the wave
  increases, thus, roughening the surface more. As the surface roughness increases,
  more energy is backscattered and NRCS increases. Moreover, careful examination of
  the wind-generated waves reveals that these surface wave crests are generally aligned
  perpendicular to the prevailing wind direction, suggesting a dependence of backscatter
  on the relative direction between the incident radar energy and the wind direction.
  This data set consists of high resolution sea surface winds data derived from SAR
  on-board RADARSAT-2 satellite. The basic archive file is a NetCDF4 file containing
  SAR wind, a land mask, and time and earth location information. Also archived are
  the maps of the SAR wind in GeoTiFF format. The product utilizes the CoastWatch
  product format and covers the geographic extent of the SAR image frame from which
  it was derived.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
